    <p class=MsoNormal>Para Mamá :</p>
    <p class=MsoNormal>Muchas <span class=GramE>gracias</span> mamá , por los apoyos
    , las risas , los buenos ratos y siempre demostrar una gran sonrisa sin
    importar la situación , por entenderme , el amor incondicional e infinito
    que siempre me entrega , de verdad muchas gracias. De la única manera que
    le puedo agradecer por ahora es darle las gracias y demostrarle con todas
    mis fuerzas de que soy y seré una gran persona. </p>
